import React from 'react';
import {
    Switch,
    Route,
} from "react-router-dom";
import Home from '../containers/Home/Home'

const appRoutes = (
    <Switch>
        <Route component={Home} expac path='/' />
    </Switch>
);
export default appRoutes;
